import "./land.css";
import skateboard from '../Images/skateboard.png';
import shoe from '../Images/shoes.png';

const Land = () => {

    return (
        <div className="content">
        <div className="split left">
          <img src={skateboard} alt="" className="skateboard"/>
          <div className="text">
            <p className="subtitle">cruiser skateboard</p>
            <h1 className="title">mmm ahhh <br/> ..push it!</h1>
            <p className="desc">Lorem ipsum dolor sit, amet consectetur adipisicing elit. Alias sint voluptatem tempora ipsam
              expedita?</p>
            <button className="button">Discover More</button>
          </div>
        </div>
        <div className="split right">
          <img src={shoe} alt="" className="shoes"/>
          <div className="text">
            <p className="subtitle">adidas pharrel williams tennis hu</p>
            <h1 className="title">because <br/> i'm happy <br/> again</h1>
            <p className="desc">Lorem ipsum dolor sit, amet consectetur adipisicing elit. Alias sint voluptatem tempora ipsam
              expedita?</p>
            <button className="button">Discover More</button>
          </div>
        </div>
      </div>
    );
} 

export default Land;
